body, html {
  width: 100%;
  height: 100%;
}

body, .font {
  margin: 0px;
  padding: 0px;
  font-family: 'Press Start 2P', cursive;
}

* {
  box-sizing: border-box;
}

.coollist {
  margin: 0px;
  padding: 0px;
  width: 100%;
}

.coollist > li {
  color: #222;
  background: whitesmoke;
  transition: all ease 0.5s;
  transition-delay: 0.3s;
  display: block;
  position: relative;
  max-height: 100px;
}

.coollist > li > .inner {
  height: 50px;
  padding: 10px;
  transition: all ease 0.3s;
  border-bottom: 1px solid white;
}

.coollist > li.hide {
  max-height: 0px;
  overflow: hidden;
}

.coollist > li.hide > .inner {
  opacity: 0;
}

.coollist > li .right-btn {
  float: right;
}
